If you’ve taken a Pilates or Barry’s Bootcamp class — or even opened Instagram lately — chances are good you’ve seen @setactive’s monochrome workout sets taking over the internet and workout studios across the country.

@lindseycarter tapped into a background in social media and marketing when she started SET in 2018, which is part of the reason the brand is so popular with Gen Zers and the influencer set. Since launching with workout sets in its signature Sculptflex fabric, SET has since expanded to include basics like sweats, T-shirts and underwear. 

Carter was a typical founder, working long days and avoiding breaks until the pandemic and her newborn son Ace came along, both of which forced her to slow down. Read how the founder balances running a growing company with becoming a new parent in our link in bio.
